  \"[Ellicott Slough National Wildlife Refuge, Farallon National Wildlife Refuge,
  Salinas River National Wildlife Refuge: Annual Narrative Report: Calendar Year 2001]\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 9,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:22.080951\",\n\t\"name\": \"ellicott-slough-national-wildlife-refuge-farallon-national-wildlife-refuge-and-salinas-riv\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ellicott
  Slough National Wildlife Refuge, Farallon National Wildlife Refuge, and Salinas
  River National Wildlife Refuge outlines Refuge accomplishments during the 2001 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, manpower programs, volunteer
  programs, funding, and safety is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, pest control, and wilderness areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, marine
  mammals, fisheries resources, scientific collections, animal control, marking and
  bird banding, and disease control. The public uses of the Refuge described in this
  report include interpretive programs, hunting, fishing, and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
